import React, { Component } from "react";
import BlockPreview from "../components/BlockPreview";
import {Container, Row, Col} from "../components/Grid";

class BrowseStories extends Component {
    render() {
        return (
            <>
            <Container fluid>
                <Row>
                    <BlockPreview newblocklink={"/read/6"} title={"Over Hump Day"} previewtext={"It never occured to Rachel that staying up all night would lead to her demise. She was so sick to his stomach the next day."} wordcount={25} contributorcount={5} />
                    <BlockPreview newblocklink={"/read/7"} title={"Big Trouble in Little Italy"} previewtext={"Steve just did it! He never thought he would actually do such a thing. Nonetheless, he had completed the worse thing he had ever done."} wordcount={31} contributorcount={5} />
                    <BlockPreview newblocklink={"/read/8"} title={"Lucky Joy Coffee"} previewtext={"Two things you never thought would be in the same sentence. Was it weird? No one else seemed to think so. What was going on?"} wordcount={25} contributorcount={5} />
                    <BlockPreview newblocklink={"/read/9"} title={"It's 2:15 Somewhere"} previewtext={"There were only two weeks of class remaining. It had to be done now. There could not be any hesitation. Any mistake would have beenn brutal."} wordcount={26} contributorcount={3} />
                    <BlockPreview newblocklink={"/read/10"} title={"Torture the Parents"} previewtext={"She just stared at him for a full minute. The light turned green, but she did not notice. It was as though time had froze."} wordcount={25} contributorcount={4} />
                </Row>
            </Container>
            </>
        )
    }
}

export default BrowseStories;
